import Home from "./pages/home";
import signUp from "./pages/signUp";
// import ProtectedRoute from "./protected.route";





function App() {

  return (
    <Router>
	<div className="App"></div>

        <Route exact path="/" component={signUp} />
        <Route exact path="/customers/:id" component={Home}/>

    </Router>
  );
}

export default App;
